Hey, lindezas!! Está com o cabelo ressecado, opaco, sem vida e cheio de frizz? Que tal apostar em uma hidronutrição poderosa?🤍✨
Itens usados:
• Mel • Açúcar • Óleo de licuri 
Benefícios: 
Mel - Hidrata e retém a água nos fios, além de propriedades nutritivas. O mel também é rico em sais minerais, vitaminas, aminoácidos, entre outros. Agindo como ação antioxidante e protetora dos fios.

Açúcar - O açúcar funciona como um poderoso esfoliante capilar e, por esse motivo, promove fios mais brilhantes, macios, alinhados e com menor quantidade de frizz.

Óleo de Licuri - o óleo nutre e hidrata os fios e o couro cabeludo, além de dar brilho e acabar com o frizz. Ele também é um excelente preventivo contra queda e caspa.

Ordem de aplicação:
Shampoo > Enxágue > Misturinha > Condicionador > Enxágue > Finalização 
